tables.table_schema:
CREATE TABLE influencer_metrics (
    influencer_id INT,
    collaboration_id INT,
    sponsorship_id INT,
    campaign_performance_metrics JSONB
);

CREATE TABLE influencers (
  influencer_id UUID PRIMARY KEY,
  name VARCHAR(255),
  location VARCHAR(255),
  followers INT
);

CREATE TABLE influencer_metrics (
    metric_id UUID PRIMARY KEY,
    influencer_id UUID,
    total_followers INT,
    engagement_rate DECIMAL
);
